class unique_arithmetic:
    def jiafa(self,jiafa1,jiafa2):
        print(jiafa1+jiafa2)

    def jianfa(self,jianfa1,jianfa2):
        print(jianfa1-jianfa2)

    def chufa(self,dividend,divisor):
        print(dividend/divisor)

    def chengfa(self,multiplicator1,multiplicator2):
        print(multiplicator1*multiplicator2)

    def pi(self):
        print(3.1415926)

    def micifang(self,micifang1,micifang2):
        print(micifang1 ** micifang2)